import AppleIcon from '../../ui/AppleIcon'
import second from '../../'

const Link = ({className, link}) => {
  const {name, url} = link
  const currentClassName = className ? `${className}__link` : 'link'

  return (
    <a class={currentClassName} href={url}>
      {name === 'apple' ? AppleIcon() : GoogleIcon()}
    </a>
  )
}

export default Link
